import styled from 'styled-components'
import {ReactComponent as MarkerSVG} from '../../assets/landlines_marker.svg'

export const Marker = styled(MarkerSVG)`
    display: block;
  width: 20px;
  height: 20px;
  cursor: pointer;
  color: #fff;
  font-size: 14px;
`

export const MarkerWrapper = styled.div`
    display: flex;
`
